import React from "react";
import { FaHome, FaPhoneVolume, FaWhatsapp } from "react-icons/fa";
import { HiOutlineMail } from "react-icons/hi";

const Footer = () => {
  return (
    <div className="footer">
      <div className="footer-container">
        <div className="left">
          <div
            className="location"
            style={{
              color: "white",
              marginRight: "2rem",
              fontWeight: "bold",
              fontSize: "1.2rem",
            }}
          >
            <FaHome size={25} style={{ color: "white", marginRight: "2rem" }} />
            Bally Howrah,West Bengal,India
          </div>
          <div
            className="phone"
            style={{
              color: "white",
              marginRight: "2rem",
              fontWeight: "bold",
              fontSize: "1.2rem",
            }}
          >
            <FaPhoneVolume
              size={20}
              style={{ color: "white", marginRight: "2rem" }}
            />
            {"/"}
            <FaWhatsapp
              size={20}
              style={{ color: "white", marginRight: "2rem" }}
            />
            8910020117
          </div>
          <div className="location">
            <HiOutlineMail
              size={20}
              style={{ color: "white", marginRight: "2rem" }}
            />
            Bally Howrah,West Bengal,India
          </div>
        </div>
      </div>
    </div>
  );
};

export default Footer;
